PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE vendor_services (
      vendor_id INTEGER NOT NULL,
      service_id INTEGER NOT NULL,
      PRIMARY KEY (vendor_id, service_id),
      FOREIGN KEY (vendor_id) REFERENCES vendors(id) ON DELETE CASCADE,
      FOREIGN KEY (service_id) REFERENCES services(id) ON DELETE RESTRICT
    );
CREATE TABLE vendors (
      id INTEGER PRIMARY KEY,
      category TEXT,
      service TEXT,
      business_name TEXT,
      contact_name TEXT,
      phone TEXT,
      address TEXT,
      website TEXT,
      notes TEXT
    , keywords TEXT, created_at TEXT, updated_at TEXT, updated_by TEXT, computed_keywords TEXT, ckw_locked INTEGER DEFAULT 0, ckw_version TEXT);
CREATE TABLE categories (id INTEGER PRIMARY KEY, name TEXT NOT NULL UNIQUE);
CREATE TABLE services   (id INTEGER PRIMARY KEY, name TEXT NOT NULL UNIQUE);
CREATE TABLE categories_lib (name TEXT PRIMARY KEY);
CREATE TABLE services_lib (  category TEXT NOT NULL,  service  TEXT NOT NULL,  PRIMARY KEY(category, service));
CREATE TABLE app_admin_probe (ts TEXT);
CREATE TABLE vendor_changes (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                vendor_id INTEGER NOT NULL,
                changed_at TEXT NOT NULL,
                changed_by TEXT NOT NULL,
                action TEXT NOT NULL,             -- 'insert' | 'update' | 'delete'
                field TEXT,                       -- null for insert/delete; otherwise changed column
                old_value TEXT,
                new_value TEXT
            );
CREATE TABLE service_synonyms (
          service_key TEXT PRIMARY KEY,
          synonyms    TEXT NOT NULL  -- JSON array of strings
        );
CREATE TABLE service_aliases (
          alias_key     TEXT PRIMARY KEY,
          canonical_key TEXT NOT NULL
        );
CREATE TABLE diag_roundtrip (
                        id INTEGER PRIMARY KEY AUTOINCREMENT,
                        guid TEXT,
                        ts TEXT
                    );
CREATE TABLE meta (k TEXT PRIMARY KEY, v TEXT NOT NULL DEFAULT '');
CREATE TABLE ckw_seeds (
  category   TEXT NOT NULL,
  service    TEXT NOT NULL,
  seed       TEXT NOT NULL,
  version    INTEGER NOT NULL DEFAULT 1,
  updated_at TEXT NOT NULL DEFAULT (datetime('now')),
  PRIMARY KEY(category, service)
);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_vendor_changes_vendor_time ON vendor_changes (vendor_id, changed_at);
CREATE UNIQUE INDEX idx_categories_name ON categories (name);
CREATE UNIQUE INDEX idx_services_name ON services (name);
CREATE INDEX idx_vendors_bus_lower ON vendors (lower (business_name));
CREATE INDEX idx_vendors_cat_lower ON vendors (lower (category));
CREATE INDEX idx_vendors_svc_lower ON vendors (lower (service));
CREATE INDEX idx_vendors_phone ON vendors (phone);
CREATE INDEX idx_vendors_ckw ON vendors (computed_keywords);
CREATE INDEX idx_vendors_cat ON vendors (category);
CREATE INDEX idx_vendors_bus ON vendors (business_name);
CREATE INDEX idx_vendors_kw ON vendors (keywords);
CREATE INDEX idx_vendors_svc ON vendors (service);
CREATE INDEX idx_vendors_ckw_status ON vendors (ckw_locked, ckw_version);
CREATE INDEX idx_ckw_seeds_cat_svc ON ckw_seeds(category, service);
COMMIT;
